import React from "react";

import Login from "./components/login";
import Register from "./components/register";
import UserSettings from "./components/userSettings";
import Preferences from "./components/preferences";
import "./App.css";

const user = true;

function App() {
  return (
    <div className="App">
      {user ? <Login /> : <Register />}
      <UserSettings />
      <Preferences />
      <div>hello world</div>
    </div>
  );
}

export default App;
